import React from 'react';


const Table = (props) => {

  if(props.available==true){
    return(
      <button
        id = "table-button-green"
        class = "button"
        type = "submit">
        Table {props.id} (Seats {props.capacity})
      </button>
    );
    return(
      <button
        id = "table-button-red"
        class = "button"
        type = "submit">
        Table {props.id} (Seats {props.capacity})
      </button>
    );
  };
};

export default Table;
